import React from "react";

class Fish extends React.Component {
  render() {
    // Fish information was passed on in App.js via a prop called "details". To prevent from having to write this.props.details.image and so on, create a varibale fishDetails
    const fishDetails = this.props.details
    return (
      <li className="menu-fish">
        <img src={fishDetails.image} alt={fishDetails.name} />
        <h3 className="fish-name">{fishDetails.name}</h3>
      </li>
    );
  }
}

export default Fish;
